import React from 'react';
import { View, Text, Image, } from 'react-native';
import Icon from '../assets/Food.png';

function Cart(props) {
    return (
        <View style={{
            height: 190,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 2,
            elevation: 2,
            shadowOpacity: .5,
            borderRadius: 5,
            padding: 10,
            flexDirection:'row',
        }}>
            <View style={{
                alignItems:'center',
                

            }}>
            <Image  style={{
                    height:'90%',
                    width:'90%',
                }} source={Icon} />
            </View>
            <View style={{
                backgroundColor:'blue',
                width:'50%',
            }}>
                <Text>
                    hi
                </Text>
            </View>

        </View>
    );
}

export default Cart;
